import React,{Component} from 'react';
import './App.css';
class  App extends Component{

    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <img src='https://www.prasac.com.kh/wp-content/uploads/2018/08/Prasac_logo.png' className="App-logo" alt="logo" />
                    <p>
                        Welcome to React Docker Demo
                    </p>
                </header>
            </div>
        );
    }
}

export default App;
